package com.alex.blog.model;import com.alex.blog.base.BaseModel;import java.util.Date;/** * 文章评论表 Model * * @author alex * @date 2019-09-09 22:24:02 */public class BlogArticleComment extends BaseModel {		/** 	* 自增id	*/	private Integer id;	/** 	* 用户id	*/	private Integer userId;	/** 	* 文章id	*/	private Integer articleId;	/** 	* 评论内容	*/	private String commentContent;	/** 	* 父级评论id	*/	private Integer commentParentId;	/** 	* 创建时间	*/	private Date createTime;	/** 	* 更新时间	*/	private Date updateTime;		public Integer getId() {	    return this.id;	}	public void setId(Integer id) {	    this.id=id;	}	public Integer getUserId() {	    return this.userId;	}	public void setUserId(Integer userId) {	    this.userId=userId;	}	public Integer getArticleId() {	    return this.articleId;	}	public void setArticleId(Integer articleId) {	    this.articleId=articleId;	}	public String getCommentContent() {	    return this.commentContent;	}	public void setCommentContent(String commentContent) {	    this.commentContent=commentContent;	}	public Integer getCommentParentId() {	    return this.commentParentId;	}	public void setCommentParentId(Integer commentParentId) {	    this.commentParentId=commentParentId;	}	public Date getCreateTime() {	    return this.createTime;	}	public void setCreateTime(Date createTime) {	    this.createTime=createTime;	}	public Date getUpdateTime() {	    return this.updateTime;	}	public void setUpdateTime(Date updateTime) {	    this.updateTime=updateTime;	}}